import "./App.css";
import Home from "./components/Home";
import Login from "./components/Login";
import { Routes, Route, Router } from "react-router-dom";
function App() {
  return (
    <div className="App">
      <Routes>
        < Router path="/" element={<Login />} />
        // <Route path="/" element={<Login />}/>
        // <Route path="/home" element={<Home /> }/>
      </Routes>
      <>
       <Login />
      </>
    </div>
  );
}

export default App;
